import React from "react";
import question from "../../tests/test/task1_11.png";

const styles = {
  but: {
    width: "200px",
    height: "50px",
  },
  row: {},
};

export default function TestCard(props) {
  const id = props.links;
  return (
    <div>
      <img src={question} />
      <div style={styles.row}>
        <input />
        <div className="button login" style={styles.but}>
          PIZDA
        </div>
      </div>
    </div>
  );
}
